b'Emirates SkyCargo says \xe2\x80\x98hola\xe2\x80\x99 to Guadalajara, Mexico. 

Our inaugural @Boeing 777 Freighter service received a warm welcome upon arrival at Mexico\xe2\x80\x99s second largest urban centre.

Guadalajara is Emirates SkyCargo\xe2\x80\x99s second cargo destination in Mexico and its 15th cargo destination in the Americas.

