b'Our flagship @Airbus A380 will return to Toronto with five flights a week starting from 16 August, taking our global A380 network to six cities. 

The Emirates A380 remains a favourite amongst travellers for its comfortable and spacious cabins and we will continue to gradually expand the deployment of our flagship aircraft in line with market demand and operational approvals.

@TorontoPearson @DXB'

b'We will deploy our flagship @Airbus A380 to Guangzhou starting from 8 August 2020.

Our iconic double-decker aircraft also returned to Amsterdam and Cairo on 1 August resuming commercial services for the first time since March. 

We look forward to gradually expand the A380\xe2\x80\x99s deployment to more destinations in line with customer demand.

