b'Today we touched down to a warm welcome in Seychelles, as Emirates became the first international airline to return to the scenic island country, coinciding with its re-opening to tourists. @visitseychelles

We also resumed passenger services from @DXB to Addis Ababa, Clark, Dar es Salaam and Stockholm today, with flights to Nairobi, Prague and S\xc3\xa3o Paulo set to launch on 2 August. 

