b'Our iconic @Airbus A380 returned to the skies today with flights to London Heathrow and Paris. We will also launch a daily A380 service to Amsterdam and a second daily A380 service to London Heathrow starting from 1 August.

We are also resuming scheduled passenger services to seven cities today \xe2\x80\x93 Athens, Barcelona, Geneva, Glasgow, Larnaca, Munich and Rome \xe2\x80\x93 offering our customers more travel options with flights to over 50 destinations worldwide.

@heathrow_airport @parisaeroport @schiphol @DXB'

